import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Add an item to the cart so that we can remove it
    // Find the first "Add to Cart" button and click it
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });
    const addToCartButtons = await page.$$('button.add-to-cart');
    if (addToCartButtons.length === 0) {
      throw new Error('No "Add to Cart" button found');
    }
    await addToCartButtons[0].click();

    // Wait for notification to appear and disappear (optional, but ensures cart is updated)
    await page.waitForTimeout(1000);

    // Open the cart modal (simulate clicking on the cart icon/counter)
    // The cart is a div with class "cart", and clicking it opens the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear (cartModal id)
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of cart before removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Wait for the "Remove" button in the cart modal and click it
    await page.waitForSelector('#cartModal .remove-item', { timeout: 5000 });
    const removeButtons = await page.$$('#cartModal .remove-item');
    if (removeButtons.length === 0) {
      throw new Error('No "Remove" button found in cart');
    }
    await removeButtons[0].click();

    // Wait for the cart to update (cart should show "Your cart is empty")
    await page.waitForSelector('#cartModal .empty-cart', { timeout: 5000 });

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Extract cart status text to verify
    const cartStatus = await page.$eval('#cartModal .empty-cart', el => el.textContent.trim());

    return {
      success: true,
      action: "Removed an item from the cart and verified the cart is empty",
      extractedData: {
        cartStatus
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
